package com.cnfantasia.server.domainbase.userCoupon.entity;/* import java.io.Serializable;*/import java.io.Serializable;import java.math.BigInteger;import java.lang.Integer; import com.cnfantasia.server.domain.pub.BaseEntity;import com.cnfantasia.server.domainbase.coupon.entity.Coupon;/** * 描述:(用户所持消费券表) 实体类 *  * @version 1.00 * @author null *  *//*public class UserCoupon implements Serializable{*/public class UserCoupon extends BaseEntity{	private static final long serialVersionUID = 1L;	/**  */	private BigInteger id;	/** 消费券拥有者ID */	private BigInteger tUserFId;	/** 消费券ID */	private BigInteger tCouponFId;	/** 来源订单ID */	private BigInteger tEbuyOrderFId;	/** 可用开始时间 */	private String useStartDate;	/** 可用结束时间 */	private String useEndDate;	/** 消费券状态 */	private Integer status;	/** 消费券获取方式 1消费送券 2分享得券*/	private Integer getType;	private Coupon coupon;	public UserCoupon(){	}	public UserCoupon(UserCoupon arg){		this.id = arg.getId();		this.tUserFId = arg.gettUserFId();		this.tCouponFId = arg.gettCouponFId();		this.tEbuyOrderFId = arg.gettEbuyOrderFId();		this.useStartDate = arg.getUseStartDate();		this.useEndDate = arg.getUseEndDate();		this.status = arg.getStatus();		this.sys0AddTime = arg.getSys0AddTime();		this.sys0UpdTime = arg.getSys0UpdTime();		this.sys0AddUser = arg.getSys0AddUser();		this.sys0UpdUser = arg.getSys0UpdUser();		this.sys0DelUser = arg.getSys0DelUser();		this.sys0DelState = arg.getSys0DelState();		this.sys0DelTime = arg.getSys0DelTime();	}	/**	 * 	 * @param id 	 * @param tUserFId 消费券拥有者ID	 * @param tCouponFId 消费券ID	 * @param tEbuyOrderFId 来源订单ID	 * @param useStartDate 可用开始时间	 * @param useEndDate 可用结束时间	 * @param status 消费券状态	 * @param sys0AddTime 新增时间	 * @param sys0UpdTime 更新时间	 * @param sys0AddUser 	 * @param sys0UpdUser 	 * @param sys0DelUser 	 * @param sys0DelState 	 * @param sys0DelTime 	 */	public UserCoupon(BigInteger id,BigInteger tUserFId,BigInteger tCouponFId,BigInteger tEbuyOrderFId,String useStartDate,String useEndDate,Integer status,String sys0AddTime,String sys0UpdTime,BigInteger sys0AddUser,BigInteger sys0UpdUser,BigInteger sys0DelUser,Integer sys0DelState,String sys0DelTime){		this.id = id;		this.tUserFId = tUserFId;		this.tCouponFId = tCouponFId;		this.tEbuyOrderFId = tEbuyOrderFId;		this.useStartDate = useStartDate;		this.useEndDate = useEndDate;		this.status = status;		this.sys0AddTime = sys0AddTime;		this.sys0UpdTime = sys0UpdTime;		this.sys0AddUser = sys0AddUser;		this.sys0UpdUser = sys0UpdUser;		this.sys0DelUser = sys0DelUser;		this.sys0DelState = sys0DelState;		this.sys0DelTime = sys0DelTime;	}	@Override	public String toString() {		StringBuffer sbf = new StringBuffer();		sbf.append("id=").append(id).append(";");		sbf.append("tUserFId=").append(tUserFId).append(";");		sbf.append("tCouponFId=").append(tCouponFId).append(";");		sbf.append("tEbuyOrderFId=").append(tEbuyOrderFId).append(";");		sbf.append("useStartDate=").append(useStartDate).append(";");		sbf.append("useEndDate=").append(useEndDate).append(";");		sbf.append("status=").append(status).append(";");		sbf.append("sys0AddTime=").append(sys0AddTime).append(";");		sbf.append("sys0UpdTime=").append(sys0UpdTime).append(";");		sbf.append("sys0AddUser=").append(sys0AddUser).append(";");		sbf.append("sys0UpdUser=").append(sys0UpdUser).append(";");		sbf.append("sys0DelUser=").append(sys0DelUser).append(";");		sbf.append("sys0DelState=").append(sys0DelState).append(";");		sbf.append("sys0DelTime=").append(sys0DelTime).append(";");		return sbf.toString();	}		public BigInteger getId() {		return id;	}	public void setId(BigInteger id) {		this.id = id;	}	public BigInteger gettUserFId() {		return tUserFId;	}	public void settUserFId(BigInteger tUserFId) {		this.tUserFId = tUserFId;	}	public BigInteger gettCouponFId() {		return tCouponFId;	}	public void settCouponFId(BigInteger tCouponFId) {		this.tCouponFId = tCouponFId;	}	public BigInteger gettEbuyOrderFId() {		return tEbuyOrderFId;	}	public void settEbuyOrderFId(BigInteger tEbuyOrderFId) {		this.tEbuyOrderFId = tEbuyOrderFId;	}	public String getUseStartDate() {		return useStartDate;	}	public void setUseStartDate(String useStartDate) {		this.useStartDate = useStartDate;	}	public String getUseEndDate() {		return useEndDate;	}	public void setUseEndDate(String useEndDate) {		this.useEndDate = useEndDate;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}	public Integer getGetType() {		return getType;	}	public void setGetType(Integer getType) {		this.getType = getType;	}	public Coupon getCoupon() {		return coupon;	}	public void setCoupon(Coupon coupon) {		this.coupon = coupon;	}	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((id == null) ? 0 : id.hashCode());		return result;	}		@Override	public boolean equals(Object obj) {		if (this == obj)			return true;		if (obj == null)			return false;		if (getClass() != obj.getClass())			return false;		UserCoupon other = (UserCoupon) obj;		if (id == null) {			if (other.id != null)				return false;		} else if (!id.equals(other.id))			return false;		return true;	}	}